        new( "PlanetDebilitationPoint(PlanetNameplanetName)","7341",""," Gets the exact longitude where planet is DebilitatedDebility TODO method needs testing Note Rahu ketu have debilitation points ref Astroloy for Beginners pg. 12 planet to sign relationship is the whole sign this is just a point The 7th house or the 180th degree from the place of exaltation is the place of debilitation or fall. The Sun is debilitated in the 10th degree of Libra the Moon 3rd of Scorpio and so on. The debilitation or depression points are found by adding 180 to the maximum points given above. While in a state of fall planets give results contrary to those when in exaltation. ref Astroloy for Beginners pg. 11 ","{ 'PlanetDebilitationPoint': { 'Name': 'Libra', 'DegreesIn': { 'DegreeMinuteSecond': '10° 0' 0', 'TotalDegrees': '10' } }}"),
