        new( "PlanetAshtakvargaBindu(PlanetNameplanet,ZodiacNamesignToCheck,Timetime)","7960",""," Give a planet and sign and ashtakvarga bindu can be calculated EXP In the Suns own Ashtakvarga there are 5 bindus in Aries NOTE ON USE Ashtakvarga System pg.128 For example in the Standard Horoscope the Suns transit of Aries 3rd from Moon should prove favorable. In the Suns own Ashtakvarga there are 5 bindus in Aries. Therefore the good effects produced should be to the extent of 62. The Suns transit of Capricorn 12th from the Moon should prove adverse. Capricorn has no bindus.Therefore the evil results to be produced by this transit are to the brim. ","{ 'PlanetAshtakvargaBindu': '5'}"),
        new( "GocharaKakshas(TimecheckTime,TimebirthTime)","7993",""," Kakshyas for daily use The concept of Kakshyas can be employed for daily use. The method of this application is simple. Prepare the Prastaraka charts for the seven planets. Then find out the longitudes of each of the seven planets on a given day. In the Prastaraka of the Sun see if the transiting Sun is passing through a Kakshya with a benefic point. For the Moons transit consider the Prastaraka of the Moon. See for all the planets. When several planets are transiting the Kakshyas where the natal planets have contributed benefic points that day is auspicious. When several planets transit the Kakshyas where there are no benefic points it is adverse time for the native The Concept of Kakshya The Prastaraka charts for different planets can be represented in a different manner to make use of the concept of Kakshyas. Each rashi or sign is divided into eight equal parts or Kakshyas The Prastaraka chart for each planet can thus be readjusted to bring in the concept of the Kakshyas. A planet is considered to be productive ofbenefic results when it transits a Kakshya where there is a benefic point ","{ 'GocharaKakshas': { 'Sun': { 'Sign': 'Virgo', 'KakshaScore': 0, 'KakshaLord': 'Ascendant', 'Ashtaka': 4, 'Sarvashtaka': 23 }, 'Moon': { 'Sign': 'Aquarius', 'KakshaScore': 0, 'KakshaLord': 'Mars', 'Ashtaka': 3, 'Sarvashtaka': 27 }, 'Mars': { 'Sign': 'Scorpio', 'KakshaScore': 0, 'KakshaLord': 'Venus', 'Ashtaka': 5, 'Sarvashtaka': 29 }, 'Mercury': { 'Sign': 'Libra', 'KakshaScore': 0, 'KakshaLord': 'Saturn', 'Ashtaka': 3, 'Sarvashtaka': 26 }, 'Jupiter': { 'Sign': 'Gemini', 'KakshaScore': 1, 'KakshaLord': 'Moon', 'Ashtaka': 7, 'Sarvashtaka': 33 }, 'Venus': { 'Sign': 'Virgo', 'KakshaScore': 0, 'KakshaLord': 'Mercury', 'Ashtaka': 4, 'Sarvashtaka': 23 }, 'Saturn': { 'Sign': 'Leo', 'KakshaScore': 0, 'KakshaLord': 'Saturn', 'Ashtaka': 3, 'Sarvashtaka': 26 } }}"),
